  false,\n\t\"url\": null,\n\t\"notes\": \"This Digital Elevation Model (DEM) dataset,
  published at 1:1200 (1in=100ft) scale, was produced all or in part from LIDAR information
  as of 2005. It is described as 'Allegany County DEM 10 ft pixel'. Data by this publisher
  are often provided in State Plane coordinate system; in a Lambert Conformal-conic
  projection; The extent of these data is generally Allegany County, MD,Cumberland,
  MD,Frostburg, MD,Lonaconing, MD,Midland, MD,Barton, MD,Westernport, MD,Luke, MD.
  The approximate post spacing interval used in the production of this layer is 2
  meter. It will support a 2 feet contour interval. These data include don't break
  lines Control monumentation used to create these data are not available. This metadata
  was auto-generated through the Ramona GIS Inventory System (www.gisinventory.net)
